import React from 'react'
import MainLayout from '../layouts/MainLayout';
import { NavLink } from 'react-router-dom';

const Home = () => {
  return (
    <MainLayout>
        <h2 className="mt-3">Home</h2>
        <hr />
        <NavLink to="/product/new" className="btn btn-success">
            Add a Product
          </NavLink>
    </MainLayout>
  )
}

export default Home
